import { React, useEffect, useState } from "react";
import ApproveUser from "./approveUserpage.js";
import ApproveAdmin from "./approveAdminpage.js"
import axios from 'axios';

function Approve() {

	const [user, setUser] = useState([]) //현재 로그인 사용자 정보

	useEffect(() => {
		axios.get('http://localhost:8081/userpage').then((res1) => {
			setUser(res1.data)
		})
	}, [])

		return(
			<>
			{
				user.id === 'admin' //관리자 계정일때만 보이는 ui
					? 
					<div>
						<ApproveAdmin />
					</div>
					:  
					<div>
						<ApproveUser />
					</div>
			}
		</>
		)
}

export default Approve;
